	256 : {"q_id":46,"answer":"I don‚Äôt know how US car insurance works, but in the U.K. , most of what you pay is to cover a major accident and someone getting killed and the liability for that which could run into 1000s.¬† To that end the type of car and your driving record has a much bigger effect on your premium than the value of the car.","user":"F","u_id":"HdLKZwkyaa","userpage":"https://answers.yahoo.com/activity/questions?show=HdLKZwkyaa","likes":"1","dislikes":"0"},
