	404 : {"q_id":73,"answer":"Think and Grow Rich¬† is one of several old-school classics on this list and its place is well-earned. For twenty years, author Napoleon Hill studied the most successful people of his time, including Henry Ford and Alexander Graham Bell and chronicled those findings together into one neat little package.The main takeaway? A focused, burning desire (or the power of a made-up mind, what Wayne Dyer called intention), gives us the power to achieve or acquire what we want most in life.If you‚Äôre looking for insights on how to achieve your dream or a specific goal, this is a classic you can‚Äôt do without.The Power of Positive Thinking by Dr. Norman Vincent PealeDr. Peale‚Äôs classic is the quintessential self-help book, being one of just a handful of early books from around the 1950s that shaped the entire self-improvement space as a whole. For that reason, there are many themes in the book that you‚Äôll see echoed throughout many of the other books on this list. However, the perspective is slightly different and a refreshing change.The value of positive thinking is such a basic mantra of self-improvement that it‚Äôs now almost overlooked. The Power of Positive Thinking is great for anyone looking to get back basics and learn some of the fundamental lessons that are critical to believing self-confidence and an optimistic mindset.The Magic of Thinking Big by David J. SchwartzThe Magic of Thinking Big is a book that I‚Äôll always remember because reading it was probably the first time I was introduced to the true power of the mind. Like Peale‚Äôs Positive Thinking, this is another classic, so the examples and speech that Schwartz uses are often entertaining in themselves.Above all else, The Magic of Thinking Big will teach you not to short-change yourself. Think big, don‚Äôt settle, and watch as a simple shift in the way you think literally changes your results.The Magic of Thinking Big is great for anyone looking to learn more about how to use the mind to achieve higher levels of success.","user":"Nacy","u_id":"9IX8v74Caa","userpage":"https://answers.yahoo.com/activity/questions?show=9IX8v74Caa","likes":"1","dislikes":"0"},
